import React from 'react';

const Breadcrumb = ({ className = "" }) => {
    return (
        <div className={`action-page ${className}`}>
            <div className='flex'>
                <h3 className='pl-0 '>Women </h3>
                <h3 className=''> / Football </h3>
                <h3 className='text-gray-500 '> / Jerseys </h3>
            </div>
        </div>
    );
};

export default Breadcrumb;
